$.each([ 'dairy', 'Snacks', 'FruitAndVegetables', 'Grocery', 'Drinks', 'meat', 'prepack', 'confection', 'household', 'Bakery', 'alcohol', 'cannedFoods' ], function( index, value ) {
    $('#' + value).click(function () {
        $(".header_cat").empty();
        if (value == 'dairy') {
            $(".header_cat").prepend('Молочная продукция');
        } else if (value == 'Snacks') {
            $(".header_cat").prepend('Снэки');
        } else if (value == 'FruitAndVegetables') {
            $(".header_cat").prepend('Фрукты и овощи');
        } else if (value == 'Grocery') {
            $(".header_cat").prepend('Бакалея');
        } else if (value == 'Drinks') {
            $(".header_cat").prepend('Напитки');
        } else if (value == 'meat') {
            $(".header_cat").prepend('Мясо и Рыба');
        } else if (value == 'prepack') {
            $(".header_cat").prepend('Полуфабрикаты');
        } else if (value == 'confection') {
            $(".header_cat").prepend('Кондитерские изделия');
        } else if (value == 'household') {
            $(".header_cat").prepend('Бытовые товары');
        } else if (value == 'Bakery') {
            $(".header_cat").prepend('Выпечка');
        } else if (value == 'alcohol') {
            $(".header_cat").prepend('Алкоголь');
        } else if (value == 'cannedFoods') {
            $(".header_cat").prepend('Консервы');
        }
        window[current] = '';
        window[current] = $(".products-wrap").html();
        $(".products-wrap").empty();
        $(".products-wrap").prepend(window[value]);
        current = value;
    });
});

